import React from "react";
import "./ProfileCard.scss"

const ProfileCard = () => {
  return (
    <div className="profile-card-container">
      <div className="profile">
        <div className="photo">
          <img src="http://2.bp.blogspot.com/-8FpnW826Jcs/XiLtTpornQI/AAAAAAAAAwY/aN8KsAjSP-EqLRdGiU8_MtUelja7DZgpwCK4BGAYYCw/s320/Jatin3.jpeg" />
        </div>
        <div className="content">
          <div className="text">
            <h3>Jatin Rao</h3>
            <h6>Front-End Web Developer</h6>
          </div>
          <div className="btn">
            <span></span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProfileCard;
